// Create a lookup map for O(1) access
const permutationMap = new Map<string, AuroraPermutation>();
AURORA_PERMUTATIONS.forEach(p => {
  const key = `${p.kpLevel}|${p.bzLevel}|${p.btLevel}|${p.speedLevel}|${p.densityLevel}`;
  permutationMap.set(key, p);
});

/**
 * Look up a permutation by parameter levels
 * Returns the pre-calculated probability and aurora characteristics
 */
export function lookupPermutation(
  kpLevel: string,
  bzLevel: string,
  btLevel: string,
  speedLevel: string,
  densityLevel: string
): AuroraPermutation | undefined {
  const key = `${kpLevel}|${bzLevel}|${btLevel}|${speedLevel}|${densityLevel}`;
  return permutationMap.get(key);
}
